import React, { useEffect, useState, useRef } from "react";
import { Code, Palette, Server, Database, Globe, LayoutGrid } from "lucide-react";

function SkillsSection() {
  const [isVisible, setIsVisible] = useState(false);
  const sectionRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setIsVisible(true);
          observer.unobserve(sectionRef.current);
        }
      },
      { threshold: 0.2 }
    );

    if (sectionRef.current) {
      observer.observe(sectionRef.current);
    }

    return () => {
      if (sectionRef.current) {
        observer.unobserve(sectionRef.current);
      }
    };
  }, []);

  const skillCategories = [
    {
      name: "Front-end",
      icon: <Code size={28} />,
      color: "from-blue-500 to-cyan-400",
      skills: [
        { name: "React", icon: "/icons/react.svg" },
        { name: "Next.js", icon: "/icons/nextjs.svg" },
        { name: "JavaScript", icon: "/icons/javascript.svg" },
        { name: "TypeScript", icon: "/icons/typescript.svg" },
        { name: "Tailwind CSS", icon: "/icons/tailwind.svg" },
        { name: "HTML5", icon: "/icons/html5.svg" },
        { name: "CSS3", icon: "/icons/css3.svg" },
        { name: "Vue.js", icon: "/icons/vue.svg" }
      ]
    },
    {
      name: "Back-end",
      icon: <Server size={28} />,
      color: "from-purple-500 to-indigo-400",
      skills: [
        { name: "Node.js", icon: "/icons/nodejs.svg" },
        { name: "Express", icon: "/icons/express.svg" },
        { name: "PHP", icon: "/icons/php.svg" },
        { name: "Laravel", icon: "/icons/laravel.svg" },
        { name: "Python", icon: "/icons/python.svg" },
        { name: "Django", icon: "/icons/django.svg" },
        { name: "GraphQL", icon: "/icons/graphql.svg" },
        { name: "REST API", icon: "/icons/api.svg" }
      ]
    },
    {
      name: "Base de données",
      icon: <Database size={28} />,
      color: "from-amber-500 to-orange-400",
      skills: [
        { name: "MongoDB", icon: "/icons/mongodb.svg" },
        { name: "MySQL", icon: "/icons/mysql.svg" },
        { name: "PostgreSQL", icon: "/icons/postgresql.svg" },
        { name: "Firebase", icon: "/icons/firebase.svg" },
        { name: "Supabase", icon: "/icons/supabase.svg" },
        { name: "Redis", icon: "/icons/redis.svg" }
      ]
    },
    {
      name: "Design",
      icon: <Palette size={28} />,
      color: "from-pink-500 to-rose-400",
      skills: [
        { name: "Figma", icon: "/icons/figma.svg" },
        { name: "Adobe XD", icon: "/icons/adobexd.svg" },
        { name: "Photoshop", icon: "/icons/photoshop.svg" },
        { name: "Illustrator", icon: "/icons/illustrator.svg" },
        { name: "InDesign", icon: "/icons/indesign.svg" },
        { name: "After Effects", icon: "/icons/aftereffects.svg" }
      ]
    },
    {
      name: "DevOps & Outils",
      icon: <LayoutGrid size={28} />,
      color: "from-sky-500 to-blue-400",
      skills: [
        { name: "Git", icon: "/icons/git.svg" },
        { name: "GitHub", icon: "/icons/github.svg" },
        { name: "Docker", icon: "/icons/docker.svg" },
        { name: "AWS", icon: "/icons/aws.svg" },
        { name: "Vercel", icon: "/icons/vercel.svg" },
        { name: "Netlify", icon: "/icons/netlify.svg" },
        { name: "VS Code", icon: "/icons/vscode.svg" },
        { name: "Webpack", icon: "/icons/webpack.svg" }
      ]
    },
    {
      name: "Frameworks & CMS",
      icon: <Globe size={28} />,
      color: "from-emerald-500 to-green-400",
      skills: [
        { name: "WordPress", icon: "/icons/wordpress.svg" },
        { name: "Shopify", icon: "/icons/shopify.svg" },
        { name: "Strapi", icon: "/icons/strapi.svg" },
        { name: "Bootstrap", icon: "/icons/bootstrap.svg" },
        { name: "Material UI", icon: "/icons/materialui.svg" },
        { name: "Chakra UI", icon: "/icons/chakraui.svg" }
      ]
    }
  ];

  return (
    <section id="competences" ref={sectionRef} className="py-24 bg-gradient-to-br from-slate-800 to-indigo-950">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section heading */}
        <div className={`text-center mb-16 transform transition-all duration-700 ${isVisible ? 'translate-y-0 opacity-100' : 'translate-y-10 opacity-0'}`}>
          <h2 className="text-3xl md:text-4xl font-bold text-white mb-4">Mes Compétences</h2>
          <div className="w-16 h-1 bg-gradient-to-r from-blue-500 to-purple-600 mx-auto rounded-full"></div>
          <p className="mt-6 text-lg text-slate-300 max-w-3xl mx-auto">
            Un aperçu des technologies et outils que je maîtrise et utilise dans mes projets de développement web et de design.
          </p>
        </div>

        {/* Skill categories grid */}
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {skillCategories.map((category, categoryIndex) => (
            <div 
              key={categoryIndex}
              className={`bg-slate-800 bg-opacity-50 backdrop-blur-lg rounded-2xl p-6 border border-slate-700 hover:border-slate-600 transition-all duration-500 hover:shadow-lg hover:shadow-indigo-900/20 transform ${isVisible ? 'translate-y-0 opacity-100' : 'translate-y-10 opacity-0'}`}
              style={{ transitionDelay: `${100 + categoryIndex * 100}ms` }}
            >
              <div className="flex items-center space-x-4 mb-6">
                <div className={`p-3 rounded-xl bg-gradient-to-br ${category.color} text-white`}>
                  {category.icon}
                </div>
                <h3 className="text-xl font-bold text-white">{category.name}</h3>
              </div>

              <div className="grid grid-cols-4 gap-4">
                {category.skills.map((skill, skillIndex) => (
                  <div 
                    key={skillIndex} 
                    className="flex flex-col items-center justify-center p-3 rounded-lg bg-slate-700 bg-opacity-50 hover:bg-opacity-70 transition-all duration-300"
                  >
                    <div className="w-10 h-10 mb-2 flex items-center justify-center">
                      <img 
                        src={skill.icon} 
                        alt={skill.name} 
                        className="max-w-full max-h-full"
                      />
                    </div>
                    <span className="text-xs text-center text-slate-300">{skill.name}</span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default SkillsSection;
